{{Infobox dungeon |name = Dyna Tree Hill |image = [[File:Dyna Tree Hill.png|thumb]] |caption = A map of Dyna Tree Hill. |tokens = 1,920,000 |location = In the middle of Ballimere Lake }} '''Dyna Tree Hill''' is a [[Dungeons|dungeon]] in [[Galar]]. It initially has 125 tiles arranged in two floors: 10x10 and 6x6 in size, respectively; including 16 chest tiles, 38 non-boss encounter tiles, 1 ladder tile, and 1 boss encounter tile. Wild Encounters have 33,216,830 HP.
